/*

Author: Sergi. J
Date:Dec, 2020

*/

@import "./reset";
@import "./vars";

/* Global start */
html {
  box-sizing: border-box;
  overflow-x: hidden;
  font-size: 10px;
  font-family: "Karma", Verdana, Tahoma, sans-serif;
}

*,
*:before,
*:after {
  -webkit-box-sizing: inherit;
  box-sizing: inherit;
}

body {
  margin: 0;
  padding: 0;
  font-size: 1.8rem;
  font-weight: 300;
  color: #444;
  background-color: #f6f6f6;
}

/* List */

ul {
  padding: 0;
  margin: 0;
  list-style-type: none;
}

/* Img */
img {
  width: 100%;
  max-width: 100%;
  height: auto;
  display: block;
}

/* Typography */
a {
  color: $primary;
}

a:link,
a:active,
a:visited,
a:focus,
a:hover {
  text-decoration: none;
}

a:active,
a:hover,
a:focus {
  color: $secondary;
  text-decoration: none;
}

h1,
h2,
h3,
h4,
h5,
h6 {
  font-weight: 500;
  padding: 0;
  margin: 0;
  color: $primary;
}

h1 {
  font-size: 3.4rem;
}

h2 {
  font-size: 3.1rem;
}

h3 {
  font-size: 2.9rem;
}

h4 {
  font-size: 2.6rem;
}

h5 {
  font-size: 2.2rem;
}

h6 {
  font-size: 1.9rem;
}

p {
  padding: 0;
  margin: 0;
}

/* Container */
.container {
  width: 100%;
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2em;
}

hr {
  box-sizing: content-box;
  height: 0;
  overflow: visible;
  border: 0;
  border-top: 1px solid rgb(221, 221, 221);
  margin: 1em 0;
}

/* Buttons */
.btn {
  display: inline-block;
  color: #f6f6f6;
  background-color: $primary;
  transition: all 350ms ease-in-out;
  padding: 0.6em 1.4em;
  font-weight: 500;
  font-size: 2rem;
  border-radius: 1rem;
}

.btn:hover {
  background-color: $secondary;
  color: #f6f6f6;
}

/* Modal start */

.modal {
  position: fixed;
  top: 50%;
  left: 50%;
  max-width: 80%;
  max-height: 90%;
  border-radius: 1rem;
  transform: translate(-50%, -50%);
  background-color: #f6f6f6;
  padding: 2em 3em;
  box-shadow: 0 4rem 6rem rgba(0, 0, 0, 0.3);
  z-index: 1000;
  transition: all 0.5s;
  overflow: scroll;
  scrollbar-width: none;
  -ms-overflow-style: none;
  text-align: center;
  visibility: hidden;
  opacity: 0;
}

.modal--show {
  visibility: visible;
  opacity: 1;
}

.modal img {
  margin: 0 auto;
  border-radius: 1rem;
}

.modal::-webkit-scrollbar {
  width: 0px;
  background: transparent;
}

.modal__header {
  font-size: 2.6rem;
  margin-bottom: 0.5em;
  line-height: 1;
}

.modal p {
  padding: 1.5em 0;
  font-size: 1.8rem;
}

.btn--close-modal {
  font-family: inherit;
  color: $tertiary;
  position: absolute;
  top: 0;
  right: 1.5rem;
  font-size: 6rem;
  cursor: pointer;
  border: none;
  background: none;
  z-index: 200;
}
.btn--close-modal:hover,
.btn--close-modal:focus {
  opacity: 0.7;
}

.modal__content {
  padding: 1.5em 0;
}

.modal__content img {
  width: 90%;
  max-width: 40rem;
}

.overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0, 0, 0, 0.6);
  z-index: 100;
  transition: all 0.5s;
  visibility: hidden;
  opacity: 0;
}

.overlay--show {
  visibility: visible;
  opacity: 1;
}

/* About Section */

.about {
  animation-name: ani;
  animation-duration: 1s;
}

.about ul {
  display: flex;
}

.about li + li {
  margin-left: 0.5em;
}

.about__container {
  display: flex;
}

.about__img {
  flex: 0 0 25%;
  max-width: 25%;
}

.about__img img {
  border-radius: 50%;
}

.about__info {
  flex: 0 0 75%;
  max-width: 75%;
}

/* Portfolio Section */

.portfolio {
  animation-name: ani2;
  animation-duration: 1s;
}

.portfolio__row {
  display: flex;
  flex-wrap: wrap;
  margin-right: -1em;
  margin-left: -1em;
  justify-content: center;
}

.portfolio__item {
  margin-top: 1.5em;
  padding-right: 1em;
  padding-left: 1em;
  flex: 0 0 33.3333333333%;
  max-width: 33.3333333333%;
}
.portfolio__item h4 {
  padding: 0.5em 0;
  text-align: center;
  background: $quaternary;
  border-bottom-left-radius: 1rem;
  border-bottom-right-radius: 1rem;
}

.portfolio__item img {
  transition: all 450ms ease-in-out;
  border-bottom: 0;
  border-top-left-radius: 1rem;
  border-top-right-radius: 1rem;
}
.portfolio__item img:hover {
  opacity: 0.8;
}

/* Copyright Section */

footer {
  text-align: center;
  animation-name: ani3;
  animation-duration: 3s;
}

/* Animations */
@keyframes ani {
  0% {
    opacity: 0;
    transform: translateY(-100%);
  }
  100% {
    opacity: 1;
    transform: translateY(0%);
  }
}

@keyframes ani2 {
  0% {
    opacity: 0;
    transform: translateY(100%);
  }
  100% {
    opacity: 1;
    transform: translateY(0%);
  }
}

@keyframes ani3 {
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}

/* Utilities */

.padding-1 {
  padding: 0.6em 0;
}

.padding-2 {
  padding: 1.5em 0;
}

.margin {
  margin: 1.5em 0;
}

.padding {
  padding: 2em;
}

.color-orange {
  color: $secondary;
}

/* Media Queries */

@media screen and (max-width: 1080px) {
  .about__img {
    flex: 0 0 33.3333333333%;
    max-width: 33.3333333333%;
  }

  .about__info {
    flex: 0 0 66.6666666667%;
    max-width: 66.6666666667%;
  }
}

@media screen and (max-width: 990px) {
  .portfolio__item {
    flex: 0 0 50%;
    max-width: 50%;
  }
}

@media screen and (max-width: 950px) {
  .about__container {
    flex-direction: column;
    align-items: center;
    text-align: center;
  }

  .about__container ul {
    justify-content: center;
  }
  .about__img img {
    width: 25rem;
  }

  .about__img {
    flex: 0 0 100%;
    max-width: 100%;
  }

  .about__info {
    flex: 0 0 100%;
    max-width: 100%;
  }
}

@media screen and (max-width: 830px) {
  .modal {
    width: 100%;
    height: 100%;
    top: 0;
    left: 50%;
    padding-top: 3.5em;
    max-width: initial;
    max-height: initial;
    transform: translate(-50%, 0%);
  }

  .overlay {
    display: none;
  }

  .btn--close-modal {
    font-size: 8rem;
    top: -1.2rem;
  }
}

@media screen and (max-width: 700px) {
  .portfolio__item {
    flex: 0 0 100%;
    max-width: 100%;
  }
}
